import './master.css';
import React from 'react';

const populateNavLeft = (search) => {
  if (!search){
    return(
      <div className="navbar-nav">
        <a className="nav-item nav-link" href="#">About ClubSC</a>
        <a className="nav-item nav-link" href="#">Meet the Team</a>
      </div>
    );
  } else{
    return(
      <div className="navbar-nav">
        <a className="navbar-brand" href="#">
          <img src="logo.png" width="92px" height="23px" alt="" />
        </a>
        <form className="form-inline">
          <input class="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" />
        </form>
      </div>
    );
  }
};

const populateNavRight = (user) => {
  if (!user['name']){
    return(
      <form className="form-inline ml-auto">
        <button className="btn btn-outline-success">Sign In</button>
      </form>
    );
  } else {
    return (
      <a className="ml-auto align-items-center username">
        <span style={{lineHeight:'40px'}}>{user['name']}</span>
        <img alt="avatar" src={user['img']} className="avatar ml-3" />
      </a>
    );
  }
};

const Navbar = (props) => {
  return (
    <nav class="navbar navbar-expand navbar-light bg-light">
      {populateNavLeft(props.search)}
      {populateNavRight(props.user)}
    </nav>
  );
};

Navbar.defaultProps = {
  search: false,
  user: {
    name: '',
    img: ''
  }
};

export default Navbar;
